import React, { useEffect } from 'react'
import Navbar from '../../components/navbar/Navbar'
import './Dorms.css';
import { useSelector, useDispatch } from 'react-redux'
import { useNavigate, useParams } from "react-router-dom";
import { getDormById } from '../../actions/dorms';

function Dorms() {
  const navigate = useNavigate();
  const dispatch = useDispatch()
  let { id } = useParams();
  console.log(id)


  const dorms = useSelector((state) => state.dorms)
  console.log(dorms)

  useEffect(() => {
    dispatch(getDormById(id));
  }, [dispatch]);
  return (

    <div>
      <Navbar />
      {/* <center>
        <h1>ボールを食べる</h1>
        <h2>INSANELY COOL DORM CHIEF</h2>
        <p>Plan:</p>
        <ul>
          <li>Dorm info (photo rating...) on the left</li>
          <li>Reviews of the dorm on the right</li>
          Get dorm from id that is in the url
        </ul>

      </center> */}
      <center className='headersi'><h1 ><strong>{dorms.Name}</strong> reviews</h1></center>

      <div className="Flexing">
      <div className="sectionA">
        <img src={dorms.images} alt="BIGNONON" />
          <div className='jiberi'>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</div>
          <p class="starability-result" data-rating={dorms.Rating}>
          </p>

      </div>

      </div>
    </div>
  )
}
export default Dorms
